import MenuCard from "./MenuCard";
import classes from "./Menu.module.css";
import { Outlet, Link } from "react-router-dom";


const Menu=()=>{

    return(
        <MenuCard 
            classSelection='menuHorizontal' 
            styleSelection='stylePurple'>

            <ul className={classes.list}>
                <li >Home</li>
                <li >Add Expense</li>
                <li >View Expense</li>
                <li >About</li>
            </ul> 
        </MenuCard>
    );
}

export default Menu;
